import React from 'react'
import EmailField from '../components/atoms/EmailField'
import PasswordField from '../components/atoms/PasswordField'
import AnchorLink from '.../components/atoms/Anchor'
import Button from '../components/atoms/Button'
import Paragraph from '../components/atoms/Paragraph'
import Checkbox from '../components/atoms/Checkbox'
import SvgEmail from '../components/svg/Email'
import SvgPassword from '../components/svg/Password'
import SvgPerson from '../components/svg/Person'
import SvgLogo from '../components/svg/Logo'


class LoginForm extends React.Component {
    constructor(props) {
      super(props);
      this.state = {value: ''};
      this.handleChange = this.handleChange.bind(this);
      this.handleSubmit = this.handleSubmit.bind(this);
    }
  
    // Event handler for email and password field
    handleChange(event) {
      this.setState({value: event.target.value});
    }
    
    // Event handler for the submit button
    handleSubmit(event) {
      alert('A name was submitted: ' + this.state.value);
      event.preventDefault();
    }
  
    render() {
      return (
        <form onSubmit={this.handleSubmit}>
          <EmailField type="text" value={this.state.value} onChange={this.handleChange}></EmailField>
          <PasswordField type="text" value={this.state.value} onChange={this.handleChange}></PasswordField>
          <Button type="submit" value="Submit"></Button>
        </form>
      );
    }
  }


  export default LoginForm
